export const users = [
  { id: 1, name: "Alice", age: 25, isActive: true, purchases: [20, 35] },
  { id: 2, name: "Bob", age: 30, isActive: false, purchases: [10] },
  { id: 3, name: "Charlie", age: 22, isActive: true, purchases: [50, 5, 15] },
  { id: 4, name: "Diana", age: 27, isActive: true, purchases: [] },
  { id: 5, name: "Ethan", age: 35, isActive: false, purchases: [100, 30] }
];

// users with isActive property set to true
export const filterUsers = (users) => users.filter(user => user.isActive)

// users younger than 30
export const filterYoungUsers = (users) => users.filter(user => user.age < 30)
